import React from 'react';
import GithubProvider from './providers/github-providers';
import { ResetCSS } from './global/resetCSS';

const Providers = () => {
  return (
    <main>
        <GithubProvider>
            <ResetCSS />
        </GithubProvider>
    </main>
  );
};

export default Providers;
